import React, { useEffect } from "react";
import Modal from "../UI/Modal";
import classes from "./BillDetailModal.module.css";
import BillDetail from "./BillDetail";
import { uiActions } from "../../store/uiSlice";
import {useDispatch} from 'react-redux'

const BillDetailModal = (props) => {
  const dispatch=useDispatch();
  const closeButton=()=>{
    dispatch(uiActions.hideBillDetail())
  }



  return (
    <Modal>
        <div className={classes.position}>
           <BillDetail bn={props.bn} tc={props.tc} cc={props.cc}  billproducts={props.products}/> 
          
          <button className={classes.close} onClick={closeButton}>close</button>
        </div>
    </Modal>
  );
};

export default BillDetailModal;
